import React, { useState } from 'react';

const CreateComunicado = () => {
  const [formData, setFormData] = useState({
    titulo: '',
    descricao: '',
    data: '',
    beneficioPrincipal: '',
    impacto: { antes: '', agora: '', 'resultado': '' },
    inovacaoEmMovimento: '',
  });

  const [isSubmitting, setIsSubmitting] = useState(false);
  const [message, setMessage] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.includes('.')) {
      const [parent, child] = name.split('.');
      setFormData({
        ...formData,
        [parent]: { ...formData[parent], [child]: value },
      });
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);
    setMessage('Processando...');

    try {
      const response = await fetch('http://localhost:3000/api/comunicado', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        const data = await response.json();
        setMessage(`Comunicado criado! ID: ${data.comunicadoId}`);
        // Limpar o formulário após o sucesso
        setFormData({
            titulo: '',
            descricao: '',
            data: '',
            beneficioPrincipal: '',
            impacto: { antes: '', agora: '', 'resultado': '' },
            inovacaoEmMovimento: '',
        });
      } else {
        setMessage('Erro ao salvar o comunicado.');
      }
    } catch (error) {
      setMessage('Erro de conexão com o servidor.');
    } finally {
      setIsSubmitting(false);
    }
  };

  return (
    <div className="container mx-auto p-4 max-w-2xl">
      <h1 className="text-2xl font-bold mb-4 text-center">Criar Novo Comunicado</h1>
      <form onSubmit={handleSubmit} className="bg-white p-6 rounded-lg shadow-md space-y-4">

        <div>
          <label className="block text-sm font-medium text-gray-700">Título da Entrega</label>
          <input type="text" name="titulo" value={formData.titulo} onChange={handleChange} className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500" required />
        </div>

        <div>
          <label className="block text-sm font-medium text-gray-700">Descrição da Entrega</label>
          <textarea name="descricao" value={formData.descricao} onChange={handleChange} rows="3" className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500" required />
        </div>

        <div>
          <label className="block text-sm font-medium text-gray-700">Data da Entrega</label>
          <input type="date" name="data" value={formData.data} onChange={handleChange} className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500" required />
        </div>

        <div>
          <label className="block text-sm font-medium text-gray-700">Benefício Principal</label>
          <input type="text" name="beneficioPrincipal" value={formData.beneficioPrincipal} onChange={handleChange} className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500" required />
        </div>

        <div className="border border-gray-200 p-4 rounded-md bg-gray-50">
          <h2 className="text-lg font-semibold text-gray-800 mb-2">Impacto da Entrega</h2>
          <div className="space-y-2">
            <div>
              <label className="block text-sm font-medium text-gray-600">Antes</label>
              <textarea name="impacto.antes" value={formData.impacto.antes} onChange={handleChange} rows="2" className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500" />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-600">Agora</label>
              <textarea name="impacto.agora" value={formData.impacto.agora} onChange={handleChange} rows="2" className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500" />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-600">Resultado</label>
              <textarea name="impacto.resultado" value={formData.impacto.resultado} onChange={handleChange} rows="2" className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500" />
            </div>
          </div>
        </div>

        <div>
          <label className="block text-sm font-medium text-gray-700">Inovação em Movimento</label>
          <textarea name="inovacaoEmMovimento" value={formData.inovacaoEmMovimento} onChange={handleChange} rows="2" className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500" />
        </div>

        <div className="flex justify-center">
<button
  type="submit"
  className="w-full px-4 py-2 border border-transparent text-sm font-medium rounded-md shadow-sm text-white bg-elosaude-green hover:bg-elosaude-dark hover:text-elosaude-green focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-elosaude-green disabled:opacity-50 disabled:cursor-not-allowed"
>
  Salvar
</button>
        </div>
      </form>
      {message && <p className="mt-4 text-center text-sm font-medium text-gray-600">{message}</p>}
    </div>
  );
};

export default CreateComunicado;
